INSERT INTO `field_data_body` VALUES ('node','show',0,1,1,'und',0,'BROOKLYN\'S 99TH PRECINCT GETS A NEW CAPTAIN ON AN ENCORE OF THE SERIES PREMIERE OF \"BROOKLYN NINE-NINE\" TUESDAY, FEBRUARY 4, ON FOX\r\n\r\nBROOKLYN NINE-NINE Airs an All-New Episode Tonight in its New Time Period at 9:30 PM ET/PT!\r\nDetective JAKE PERALTA (Andy Samberg) is a talented, but carefree police detective at Brooklyn\'s 99th precinct who, along with his eclectic group of colleagues, are used to having a lax captain around the office. However, when tightly-wound Captain RAY HOLT (Andre Braugher) takes over, he is determined to make this dysfunctional group of detectives into the best precinct in Brooklyn\r\nCast: Andy Samberg as Det. Jake Peralta; Andre Braugher as Capt. Ray Holt; Terry Crews as Sgt. Terry Jeffords; Melissa Fumero as Det. Amy Santiago; Joe Lo Truglio as Det. Charles Boyle; Stephanie Beatriz as Det. Rosa Diaz; Chelsea Peretti as Gina Linetti','','filtered_html'),('node','show',0,2,2,'und',0,'BROOKLYN\'S 99TH PRECINCT GETS A NEW CAPTAIN ON AN ENCORE OF THE SERIES PREMIERE OF \"BROOKLYN NINE-NINE\" TUESDAY, FEBRUARY 4, ON FOX\r\n\r\nBROOKLYN NINE-NINE Airs an All-New Episode Tonight in its New Time Period at 9:30 PM ET/PT!\r\nDetective JAKE PERALTA (Andy Samberg) is a talented, but carefree police detective at Brooklyn\'s 99th precinct who, along with his eclectic group of colleagues, are used to having a lax captain around the office. However, when tightly-wound Captain RAY HOLT (Andre Braugher) takes over, he is determined to make this dysfunctional group of detectives into the best precinct in Brooklyn\r\nCast: Andy Samberg as Det. Jake Peralta; Andre Braugher as Capt. Ray Holt; Terry Crews as Sgt. Terry Jeffords; Melissa Fumero as Det. Amy Santiago; Joe Lo Truglio as Det. Charles Boyle; Stephanie Beatriz as Det. Rosa Diaz; Chelsea Peretti as Gina Linetti','','filtered_html'),('node','show',0,3,3,'und',0,'ELI AND WARNER WORK WITH A MOBSTER ON AN ALL-NEW \"DADS\" TUESDAY, FEBRUARY 4, ON FOX\r\nEli and Warner work to develop a new mafia game for Ghost Child Games and invite a real mob boss to the office to consult\r\nCast: Seth Green as Eli Sachs; Giovanni Ribisi as Warner Whittemore; Peter Riegert as David Sachs; Martin Mull as Crawford Whittemore; Vanessa Lachey as Camila Whittemore; Brenda Song as Veronica and Tonita Castro as Edna','','filtered_html'),('node','show',0,4,4,'und',0,'JESS TRIES TO CONVINCE NICK THAT IT\'S POSSIBLE TO REMAIN FRIENDS WITH AN EX ON AN ALL-NEW \"NEW GIRL\" TUESDAY, FEBRUARY 4, ON FOX\r\n\r\nAdam Brody (\"The O.C.\") Guest-Stars\r\nWhen Nick has an awkward run-in with his ex, Caroline (guest star Mary Elizabeth Ellis), Jessica tries to convince him he can still be friends with her, by introducing him to her former boyfriend, Berkley (guest star Brody). Meanwhile, Coach uses Schmidt\'s loft to impress a date, but things turn farcically disastrous when Schmidt arrives home with his own potential bedmate\r\nCast: Zooey Deschanel as Jess; Jake Johnson as Nick; Max Greenfield as Schmidt; Lamorne Morris as Winston; and Hannah Simone as Cece.','','filtered_html'),('node','show',0,5,5,'und',0,'CAPTAIN HOLT INVITES THE PRECINCT TO HIS HOUSE FOR A PARTY ON AN ALL-NEW \"BROOKLYN NINE-NINE\" TUESDAY, FEBRUARY 4, ON FOX\r\nThe officers in the precinct head over to Holt\'s house to celebrate his birthday, but they wind up making a poor impression on his husband\r\nCast: Andy Samberg as Det. Jake Peralta; Andre Braugher as Capt. Ray Holt; Terry Crews as Sgt. Terry Jeffords; Melissa Fumero as Det. Amy Santiago; Joe Lo Truglio as Det. Charles Boyle; Stephanie Beatriz as Det. Rosa Diaz; Chelsea Peretti as Gina Linetti','','filtered_html');
